column8:
・スチーム発生量:約12mL/分(吹出口2個)<br>
・給水タンク容量:200ml<br>
・スチーム温度:約40 ℃(ノズルガード先端から約20 cmの距離)<br>
・ミスト発生量:約 4 mL/分(吹出口2個)<br>
・スチーム・ミスト発生時間:約3分～約13分30秒(各コースによって異なります)<br>
・電源方式:交流式<br>
・電圧:AC100 V 50-60 Hz<br>
・消費電力:約580 W<br>
・電源コードの長さ:約1.5 m(着脱式)<br>
・本体寸法:W17.1×H20.9××D21.6 cm<br>
・質量:本体/約2kg、電源コード/約70 g<br>
・付属品:アロマタブレット2個・防水シート・お掃除針<div style="width:500px; height:410px; overflow:hidden;margin: 0 auto;"></div>


